import React, { useState, useEffect } from 'react';
import './App.css';

function App() {
  const [userdata, setUserData] = useState({
    name: '',
    email: '',
    phone: '',
    password: '',
  });
  //connecting to server
  useEffect(() => {
    fetch('http://localhost:8000/')
      .then((res) => res.json())
      .then(
        (result) => {
          setUserData(result);
        },
        (error) => {
          console.log(error);
        }
      );
  }, []);
  return (
    <div>
      <ul>
        {userdata.map((f) => {
          if (f.dir) {
            return <li>{f.name}</li>;
          } else {
            return <li>{f.name}</li>;
          }
        })}
      </ul>
    </div>
  );
}

export default App;
